def count_souvenirs_for_trains(N, M, souvenirs):

    class BitSum:

        def __init__(self, n):
            self.n = n + 3
            self.table = [0] * (self.n + 1)

        def add(self, i, x):
            i += 1
            while i <= self.n:
                self.table[i] += x
                i += i & -i

        def sum(self, i):
            i += 1
            res = 0
            while i > 0:
                res += self.table[i]
                i -= i & -i
            return res
    dlr = []
    for (l, r) in souvenirs:
        dlr.append((r - l + 1, l, r + 1))
    dlr.sort()
    bit = BitSum(M + 1)
    i = 1
    result = []
    for k in range(1, M + 1):
        while i < N and dlr[i][0] <= k:
            (d, l, r) = dlr[i]
            bit.add(l, 1)
            bit.add(r, -1)
            i += 1
        result.append(N - i + sum((bit.sum(a) for a in range(k, M + 1, k))))
    return result

